import './ListComponentSpecialize.css';

export default function ListComponentSpecialize({ title, description, image }) {
    return (
        <li className='list-component-specialize'>
            <div className='list-component-specialize__content'>
                <img src={image} alt="Site"  className='list-component-specialize__image'/>
            </div>
            <div className='list-component-specialize__block'>
                <h3 className='list-component-specialize__title'>
                    {title}
                </h3>
                <p className='list-component-specialize__description'>
                    {description}
                </p>
            </div>
        </li>
    )
}
